import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { FaStar, FaSearch } from 'react-icons/fa';
import { useNavigate } from 'react-router-dom';

const StoreList = () => {
  const [stores, setStores] = useState([]);  // Initialize as empty array
  const [searchTerm, setSearchTerm] = useState('');
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    fetchStores();
  }, []);

  const fetchStores = async () => {
    try {
      const response = await axios.get('/api/stores');
      // Ensure response.data is an array
      setStores(Array.isArray(response.data) ? response.data : []);
    } catch (err) {
      setError('Error fetching stores');
      setStores([]); // Set empty array on error
    } finally {
      setLoading(false);
    }
  };

  // Only filter if stores is an array
  const filteredStores = Array.isArray(stores) 
    ? stores.filter(store =>
        store.name.toLowerCase().includes(searchTerm.toLowerCase())
      )
    : [];

  if (loading) {
    return (
      <div className="text-center mt-5">
        <div className="spinner-border text-primary" role="status">
          <span className="visually-hidden">Loading...</span>
        </div>
      </div>
    );
  }

  return (
    <div className="container mt-4">
      <div className="row mb-4">
        <div className="col-md-6 mx-auto">
          <div className="input-group">
            <input
              type="text"
              className="form-control"
              placeholder="Search stores by name..."
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
            />
            <span className="input-group-text">
              <FaSearch />
            </span>
          </div>
        </div>
      </div>

      {error && (
        <div className="alert alert-danger" role="alert">
          {error}
        </div>
      )}

      <div className="row">
        {filteredStores.length > 0 ? (
          filteredStores.map(store => (
            <div key={store.id} className="col-md-4 mb-4">
              <div className="card h-100 shadow-sm">
                {store.imageUrl && (
                  <img
                    src={store.imageUrl}
                    alt={store.name}
                    className="card-img-top"
                    style={{ height: '200px', objectFit: 'cover' }}
                  />
                )}
                <div className="card-body">
                  <h5 className="card-title">{store.name}</h5>
                  <div className="mb-2">
                    {[...Array(5)].map((_, index) => (
                      <FaStar
                        key={index}
                        className={
                          index < Math.floor(store.averageRating || 0)
                            ? 'text-warning'
                            : 'text-muted'
                        }
                      />
                    ))}
                    <span className="ms-2">
                      ({(store.averageRating || 0).toFixed(1)})
                      <small className="text-muted ms-1">
                        {store.totalRatings || 0} reviews
                      </small>
                    </span>
                  </div>
                  <p className="card-text">{store.description}</p>
                  <p className="card-text">
                    <small className="text-muted">{store.address}</small>
                  </p>
                  <button
                    className="btn btn-primary w-100"
                    onClick={() => navigate(`/stores/${store.id}`)}
                  >
                    View Details & Rate
                  </button>
                </div>
              </div>
            </div>
          ))
        ) : (
          <div className="col-12 text-center mt-4">
            <p className="text-muted">No stores found matching your criteria</p>
          </div>
        )}
      </div>
    </div>
  );
};

export default StoreList;
